import React from "react";
import CardPizza from "../cards/cardCardapio";
import Container  from "react-bootstrap/Container";
import Row  from "react-bootstrap/Row";
import Col from "react-bootstrap/Col"

import pizzaCalabresa from '../../assets/pizzaCalabresa.jpg';
import pizzaQueijo from '../../assets/pizzaQueijo.jpg';
import pizzaDoce from '../../assets/pizzaBanana.jpg';

import './cardapioStyle.css'

export default function Recipe(){
    return(
        <Container fluid className="containerCardapio">
            <Row style={{alignItems:"center", justifyContent:"center", paddingTop:"20px"}}>
               <Col></Col>
                <CardPizza 
                    image={pizzaDoce}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
               
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaCalabresa}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
                 <CardPizza 
                    image={pizzaQueijo}
                    ingrediente="Molho de tomate;
                    Queijo mussarela;
                    Calabresa fatiada;
                    Cebola fatiada (opcional)"
                    pizza="Pizza de Calabresa"
                    preco="R$12,00"
                 />
            </Row>
        </Container>
        
    )
}
